import {BrowserRouter as Router,Routes,Route,Link} from "react-router-dom";
import { Redirect } from "react-router-dom";
import LoginPage from "./components/LoginPage";
import Notes from "./components/Notes";
import RegistrationPage from "./components/RegistrationPage";

const heading = {
  color: 'navy',
  textAlign: 'center',
  fontSize: '40px',
  fontFamily: 'Courier New '
}


function App ({user}){

    return(
        <Router>
        <div>
            <ul style = {heading}>
              <li>
                <Link to="/loginPage" style ={heading} onClick ={<LoginPage/>}>Login</Link>
              </li>
              <li>
                <Link to="/registrationPage" style ={heading} onClick={<RegistrationPage/>}>Registration</Link>
              </li>
              <li>
                <Link to="/notesApplication" style = {heading} onClick={<Notes/>}>Notes</Link>
              </li>
            </ul>

            <hr />
            <Routes>
                <Route exact path="/loginPage" element = {<LoginPage/>} />
                <Route path="/registrationPage" element={<RestrictedPage/>} /> 
                <Route path = "/notesPage" element = {<Notes/>}/>
                {user.isSignedIn ? (
                <Route exact path="/restricted" element={RestrictedPage} />
                ) : (
                <Redirect to="/loginPage" />
                )}

            </Routes>

        </div>
        </Router>
    )
};
export default App;
